  true,\n\t\"url\": null,\n\t\"notes\": \"Treasury plans to sell up to $10 billion
  of securities per month, subject to market conditions.  This is in addition to principal
  paydowns (currently ranging between $2 and $4 billion per month).   If the sales
  proceeded at the full $10 billion per month, the portfolio would be unwound in whole
  over approximately one year, depending on future rates of prepayments. If market
  conditions change and Treasury slows asset sales, it is possible that the unwind
  will take a longer period of time.  Excel data shows the total principal and interest
  that the Treasury received from purchase to sell off of the MBS securities.\",\n\t\"owner_org\":
